import { useEffect, useState } from 'react';
import { Box, createTheme, Stack, ThemeProvider } from '@mui/material';
import Add from '../components/Profile/Add';
import Feed from '../components/Profile/Feed';
import Navbar from '../components/Profile/Navbar';
import Rightbar from '../components/Profile/Rightbar';
import Sidebar from '../components/Profile/Sidebar';
import { TYPE_THEME_LOOKUP } from '../shared';
import { darkTheme, defaultTheme } from '../theme';
import Grid from '@mui/material/Grid';
import Ranking from '../components/Ranking';
import Nav from '../components/Navbar'

const Profile = () => {
    const [mode, setMode] = useState(TYPE_THEME_LOOKUP.light);
    const [theme, setTheme] = useState(defaultTheme);

    useEffect(() => {
        mode === TYPE_THEME_LOOKUP.dark
            ? setTheme(darkTheme)
            : setTheme(defaultTheme);
    }, [mode]);

    return (
        <Grid
            container
            justifyContent='center'
        >
            <Grid item xs={2}>
                <Sidebar setMode={setMode} mode={mode} />
            </Grid>
            <Grid item xs={7}>
                <Feed />
            </Grid>
            <Grid item xs={2}>
                <Ranking/>
            </Grid>
        </Grid>

    );
};

export default Profile;
